Let’s step through the design, balancing tractability and theoretical depth:

### 1. Key Psychological Mechanisms

- **Fairness Sensitivity:** Responders in economic games often compare the offer to their own contribution or the total available, displaying aversion to “unfair” (low) offers.
- **Contribution-based Equity:** Perceived fairness is not just an equal split—it also depends on relative contributions (token_self vs token_opp).
- **Self-reward:** Accept/Reject decisions also depend on the absolute amount offered (split_self).
- **Noise/Idiosyncrasy:** Choices display random-like variability; an inverse temperature parameter helps control for determinism/stochasticity.

### 2. Mechanism Interactions

- The participant evaluates both the offer’s **absolute value**, and its **relative fairness** (accounting for the division compared to what would be ‘earned’ by each based on their contribution).
- Responders may feel "entitled" to at least as much as their contribution warrants.
- "Fairness dissatisfaction" could manifest as utility depreciation proportional to deviation from a fairness norm.

### 3. Mathematical Formulation: What Will Work

Let’s build the model as follows:
- Utility = baseline for personal gain + penalty for unfairness, where unfairness is defined as the deviation of the proposed share to the responder from their "earned" share, based on relative contribution.
- Only a few parameters: one for self-gain weight (if any), one for unfairness sensitivity, plus an inverse temperature. To minimize parameter covariance, we can fix the reward scaling (units are pounds, so unit gain) and only let fairness aversion be fit.

### 4. Parameters

- fairness_weight: Sensitivity/aversion to fairness violation (how much the utility drops per unit unfairness).
- baseline: A decision bias (e.g. tendency to accept/reject offers regardless).
- inv_temp: Inverse temperature for choice stochasticity (goes into the logistic transformation and not in the utility formula; since you're using a fixed temperature, it's not included as a model parameter).

**NOT INCLUDING a parameter on absolute reward prevents idiosyncratic tradeoff with fairness_weight, reducing covariance risk.**

### 5. Mapping Variables

- "Fair" share for responder based on contribution = combined_earning × (token_self / (token_self + token_opp))
- Unfairness = fair_share - split_self

**Model:**

\( U = \) baseline + |fairness_weight| × (split_self - fair_share)

### 6. Final Model (in required specs):

<MODEL>
U = baseline + fairness_weight * (split_self - (combined_earning * token_self / (token_self + token_opp)))
</MODEL>

